// TreeView.js
import React from "react";

const TreeNode = ({ node }) => {
  if (!node) return null;

  return (
    <li key={node.id}>
      {node.name}
      {node.children && node.children.length > 0 && (
        <ul>
          {node.children.map((child, index) => (
            <TreeNode key={index} node={child} />
          ))}
        </ul>
      )}
    </li>
  );
};

const TreeView = ({ tree }) => {
  if (!tree) return <div>No tree data available</div>;

  const treeArray = Array.isArray(tree) ? tree : [tree];

  return (
    <div>
      <h3>Tree View (Collapsible)</h3>
      <ul>
        {treeArray.map((node, index) => (
          <TreeNode key={index} node={node} />
        ))}
      </ul>
    </div>
  );
};

export default TreeView;
